import {
  Modal,
  ModalNav,
  ModalNavItem,
  WelcomeWrapper,
  Wrap,
} from './Auth.styled';

function AuthPage() {
  return (
    <Wrap>
      <WelcomeWrapper>
        <Modal>
          <ModalNav>
            <ModalNavItem to="/auth/register">Registration</ModalNavItem>
            <ModalNavItem to="/auth/login">Log In</ModalNavItem>
          </ModalNav>
        </Modal>
      </WelcomeWrapper>
    </Wrap>
  );
}

export default AuthPage;
